import React from 'react';
import './App.css';
import Create_box from "./components/gallery_boxs/create_box";
import {apartments} from "./components/app_data/apartments_array";
import {cities} from "./components/app_data/cities_array";
import './components/gallery_boxs/create_box.css';


class App extends React.Component{
    render() {
        return(
            <div className={"container-grid"} id={"fourth_row"}>
                <h1>My Apartments</h1>
                <Create_box items = {apartments}/>
                <h1>My Cities</h1>
                <Create_box items = {cities}/>
            </div>
        )
    }
}

export default App;
